              "the data in *x* and *y*, you can provide the object in the *data*\n",
              "parameter and just give the labels for *x* and *y*::\n",
              "\n",
              "&gt;&gt;&gt; plot(&#x27;xlabel&#x27;, &#x27;ylabel&#x27;, data=obj)\n",
