              "`pandas.DataFrame` or a structured numpy array.\n",
              "\n",
              "\n",
              "**Plotting multiple sets of data**\n",
              "\n",
              "There are various ways to plot multiple sets of data.\n",
              "\n",
              "- The most straight forward way is just to call `plot` multiple times.\n",
              "  Example:\n",
              "\n",
